import Landing from '../Landing';
import Pages from '../Pages/inde';
import { BrowserRouter as Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/landing" omponent = {Landing} />
        <Route path="/Pages" omponent = {Pages} />
      </Routes>
    </div>
  );
}

export default App;
